    OtheruserdashboardComponent.prototype.onChange = function (Id, event) {
        var checked = event.target.checked;
        //// console.log('selected1232', this.selected);
        if (checked) {
            this.selected.push(Id);
            // this.widgetId += Id.toString() + ",";
        }
        else {
            var index = this.selected.indexOf(Id);
            this.selected.splice(index, 1);
        }
        this.values = this.selected.toString();
        var count = this.selected.length;
        this.count = count;
        //// console.log('selected', this.selected.toString());
        this.widgetId = this.selected.toString();
    };
    OtheruserdashboardComponent.prototype.save = function () {
        var _this = this;
        var count = this.selected.length;
        //// console.log('widgetId', this.widgetId);
        this.dashboardservice.SaveWidget(this.widgetId).subscribe(function (result) {
            if (result.StatusCode == 200) {
                _this.widgetId = "";
                _this.selected = [];
                window.location.reload();
                _this.toaster.success(result.responseMessage);
            }
            else {
                _this.widgetId = "";
                _this.selected = [];
                _this.toaster.success(result.responseMessage);
                window.location.reload();
            }
        });
        this.widgetId = "";
        this.selected = [];
    };
    OtheruserdashboardComponent.prototype.addedit = function () {
        this.router.navigateByUrl("dashboard/add");
    };
    OtheruserdashboardComponent.prototype.gotopage = function (item) {
        this.stage = item.masterIdAuto;
        var obj = this.FilterUrl;
        obj.stage = item.masterIdAuto;
        this.router.navigate([item.widgetRoute], { queryParams: obj });
    };
